import './index.css';


function ncard(val){
return (
  <Card 
     imgsrc={Sdata[0].imgsrc}
     title={Sdata[0].title}
     sname= {Sdata[0].sname}
     link={Sdata[0].link}
   /> 
);
}

ReactDOM.render(
<>
   <h1 className="heading_style"> List of top 5 Netflix Series in 2020</h1>


   Sdata.map(ncard);
  </> ,
  document.getElementById("root")
);
